        // Fungsi untuk membuat card kuliner
        function createKulinerCard(kuliner) {
            const card = document.createElement('div');
            card.className = 'kuliner-card';
            card.dataset.category = kuliner.category;
            
            const stars = '★'.repeat(Math.floor(kuliner.rating)) + (kuliner.rating % 1 ? '☆' : '');
            
            card.innerHTML = `
                <div class="card-image" style="background-image: url('${kuliner.image}')">
                    <div class="card-badge">${kuliner.category.charAt(0).toUpperCase() + kuliner.category.slice(1)}</div>
                </div>
                <div class="card-content">
                    <h3 class="card-title">${kuliner.name}</h3>
                    <div class="card-region">📍 ${kuliner.region}</div>
                    <p class="card-description">${kuliner.description}</p>
                    <div class="card-features">
                        <div class="rating">
                            <span class="stars">${stars}</span>
                            <span>${kuliner.rating}</span>
                        </div>
                        <div class="price">${kuliner.price}</div>
                    </div>
                </div>
            `;
            
            card.addEventListener('click', () => openModal(kuliner));
            return card;
        }

        // Fungsi untuk render semua card
        function renderKulinerCards(dataToRender = kulinerData) {
            const grid = document.getElementById('kulinerGrid');
            grid.innerHTML = '';
            
            dataToRender.forEach((kuliner, index) => {
                const card = createKulinerCard(kuliner);
                card.style.animationDelay = `${index * 0.1}s`;
                grid.appendChild(card);
            });
        }

        // Fungsi untuk filter berdasarkan kategori
        function filterByCategory(category) {
            const filteredData = category === 'all' ? kulinerData : kulinerData.filter(k => k.category === category);
            renderKulinerCards(filteredData);
            
            // Update tombol aktif
            document.querySelectorAll('.filter-btn').forEach(btn => {
                btn.classList.remove('active');
            });
            document.querySelector(`[data-category="${category}"]`).classList.add('active');
        }

        // Fungsi untuk pencarian
        function searchKuliner(query) {
            const filteredData = kulinerData.filter(kuliner => 
                kuliner.name.toLowerCase().includes(query.toLowerCase()) ||
                kuliner.region.toLowerCase().includes(query.toLowerCase()) ||
                kuliner.description.toLowerCase().includes(query.toLowerCase())
            );
            renderKulinerCards(filteredData);
        }

        // Fungsi untuk membuka modal
        function openModal(kuliner) {
            const modal = document.getElementById('kulinerModal');
            const modalHeader = document.getElementById('modalHeader');
            const modalTitle = document.getElementById('modalTitle');
            const modalRegion = document.getElementById('modalRegion');
            const modalDescription = document.getElementById('modalDescription');
            const modalInfo = document.getElementById('modalInfo');
            
            modalHeader.style.backgroundImage = `url('${kuliner.image}')`;
            modalTitle.textContent = kuliner.name;
            modalRegion.textContent = `📍 ${kuliner.region}`;
            modalDescription.textContent = kuliner.fullDescription;
            
            const stars = '★'.repeat(Math.floor(kuliner.rating)) + (kuliner.rating % 1 ? '☆' : '');
            
            modalInfo.innerHTML = `
                <div class="info-item">
                    <h4>Rating</h4>
                    <p><span style="color: #f39c12">${stars}</span> ${kuliner.rating}/5</p>
                </div>
                <div class="info-item">
                    <h4>Harga</h4>
                    <p style="color: #27ae60; font-weight: bold">${kuliner.price}</p>
                </div>
                <div class="info-item">
                    <h4>Waktu Masak</h4>
                    <p>${kuliner.cookingTime}</p>
                </div>
                <div class="info-item">
                    <h4>Level Pedas</h4>
                    <p>${kuliner.spiceLevel}</p>
                </div>
                <div class="info-item">
                    <h4>Bahan Utama</h4>
                    <p>${kuliner.ingredients}</p>
                </div>
                <div class="info-item">
                    <h4>Kategori</h4>
                    <p style="text-transform: capitalize">${kuliner.category}</p>
                </div>
            `;
            
            modal.style.display = 'block';
            document.body.style.overflow = 'hidden';
        }

        // Fungsi untuk menutup modal
        function closeModal() {
            const modal = document.getElementById('kulinerModal');
            modal.style.display = 'none';
            document.body.style.overflow = 'auto';
        }

        // Event listeners
        document.addEventListener('DOMContentLoaded', function() {
            // Render initial cards
            renderKulinerCards();
            
            // Filter buttons
            document.querySelectorAll('.filter-btn').forEach(btn => {
                btn.addEventListener('click', () => {
                    filterByCategory(btn.dataset.category);
                });
            });
            
            // Search functionality
            const searchInput = document.getElementById('searchInput');
            searchInput.addEventListener('input', (e) => {
                searchKuliner(e.target.value);
            });
            
            // Close modal when clicking outside
            window.addEventListener('click', (e) => {
                const modal = document.getElementById('kulinerModal');
                if (e.target === modal) {
                    closeModal();
                }
            });
            
            // Close modal with Escape key
            document.addEventListener('keydown', (e) => {
                if (e.key === 'Escape') {
                    closeModal();
                }
            });
        });